script: |
  super -f text -I q5611.spq | sort > q5611.out

inputs:
  - name: q5611.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 + + col1 NOT BETWEEN - col1 * - + 93 * - 83 + + - col0 + + - 51 AND - 70 + - col2 / - - col1;
  - name: tab2

outputs:
  - name: q5611.out
    data: |
      46	51	23
      64	77	40
      75	67	58
